export const passPostToStore = (posts) => {
  return(dispatch) => {
    posts
    ? dispatch({type: 'RETRIEVE_POST', posts})
    : dispatch({type: 'RETRIEVE_POST_ERR',
      error: "error retrieving content!"})
  }
}
